I’ve finished up my Block Challenge quilt!  Finally.  I know I’m a little behind, but isn’t it worth it??
Swipe to see my last four blocks and the finished quilt top. 
As you know, the block patterns are free and so is the layout pattern.  You can find them on the Riley Blake website. 
I used fabrics from my Fable collection.
Blocks are by:
